import React from "react";
import "./style.css"


function QuickAccessInstructor() {
  return (
 <Container fluid>
        <Row>
          <Col size="md-6">
            <Jumbotron>
              <h1>What Books Should I Read?</h1>
            </Jumbotron>
             <h1>Mongo Scraper</h1>
    <p>New York Times Edition</p>
          </Col>
        </Row>
      </Container>
  );
}

export default QuickAccessInstructor;
